window.bookSummaryJSON = "<p><b><i>My reasons for keeping Blue are… complicated.</i></b></p> <p>I see the scars she hides. The secrets she keeps. I want to collect all the broken pieces of her.</p> <p>When she runs, I go after her.</p> <p>I will always go after her.</p> <p>Her enemies are closing in faster than she can run.</p> <p>I vow to keep her safe, but my protection comes at a price.</p> <p>She’ll belong to me in every way.</p> <p>When she is taken from me, I hunt down her abductor and give in to my rage.</p> <p>I spill blood for her. I’d do it again.</p> <p>But the game turns deadly when some of the most powerful men of The Society attack.</p> <p>I won’t let them touch her though.</p> <p>I won’t fail Blue like I failed my sister.</p> <p>Even if she will be my undoing.</p>"; 
